import { useParams } from "react-router-dom";
import { Tabs } from "flowbite-react";

const Payment = () => {
  const { total } = useParams();

  return (
    <>
        <div className="p-5 background-color-content">
            <h1 className="text-xl font-semibold">Lakukan Pembayaran</h1>
            <h5 className="mt-10 text-xl font-semibold flex justify-center">Nominal yang harus dibayar :</h5>
            <h5 className="mt-2 text-xl font-semibold flex justify-center">$ {total}</h5>
            <h1 className="mt-10 text-xl font-semibold">Metode Pembayaran</h1>
            <Tabs.Group aria-label="Tabs with underline" style="underline">
                <Tabs.Item title="Profile">
                    Profile content
                </Tabs.Item>
                <Tabs.Item
                    active={true}
                    title="Dashboard"
                >
                    Dashboard content
                </Tabs.Item>
                <Tabs.Item title="Settings">
                    Settings content
                </Tabs.Item>
                <Tabs.Item title="Contacts">
                    Contacts content
                </Tabs.Item>
                <Tabs.Item
                    disabled={true}
                    title="Disabled"
                >
                    Disabled content
                </Tabs.Item>
            </Tabs.Group>
        </div>
    </>
  );
};

export default Payment;
